import { connectWallet } from "../config";

const Home = () => {
  const walletHandler = async () => {
    let data = await connectWallet();
    console.log("user account==>", data);
  };

  return (
    <>
      <button onClick={walletHandler}>connect wallet</button>
    </>
  );
};

export default Home;
